import React from 'react'
import Logos from './Logos'
import { useState } from 'react'

const Counter = () => {

    const [count, setCount] = useState(0)

    function increment() {
        setCount(count +1)
    }

    function decrement() {
        setCount(count[0] -1)
    }

    console.log(count[0], count[1], count[2])


    return (
        <div className='studied'>
            <button className='arrow_button left' onClick={increment}>
                    <svg className="bi bi-arrow-left-circle-fill" viewBox="0 0 16 16">
                    <path d="M8 0a8 8 0 1 0 0 16A8 8 0 0 0 8 0zm3.5 7.5a.5.5 0 0 1 0 1H5.707l2.147 2.146a.5.5 0 0 1-.708.708l-3-3a.5.5 0 0 1 0-.708l3-3a.5.5 0 1 1 .708.708L5.707 7.5H11.5z"/>
                    </svg>
                </button>
                <Logos count={count}/>    
                <button className='arrow_button right' onClick={decrement}>
                    <svg  className="bi bi-arrow-right-circle-fill" viewBox="0 0 16 16">
                    <path d="M8 0a8 8 0 1 1 0 16A8 8 0 0 1 8 0zM4.5 7.5a.5.5 0 0 0 0 1h5.793l-2.147 2.146a.5.5 0 0 0 .708.708l3-3a.5.5 0 0 0 0-.708l-3-3a.5.5 0 1 0-.708.708L10.293 7.5H4.5z"/>
                    </svg>
                </button>
        </div>
        )
        }

export default Counter
